import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { sortData } from '../Util/sort'; // Ensure sortData function handles sorting correctly

const PolicyApprovalTable = () => {
  const [policies, setPolicies] = useState([]);
  const [filteredPolicies, setFilteredPolicies] = useState([]);
  const [sortBy, setSortBy] = useState('dataPolicyName');
  const [sortDirection, setSortDirection] = useState('asc');

  useEffect(() => {
    // Fetch policies from backend
    axios.get('http://localhost:8080/policies/pending')
      .then(response => {
        console.log('Fetched policies for approval:', response.data);
        setPolicies(response.data);
        setFilteredPolicies(response.data);
      })
      .catch(error => {
        console.error('There was an error fetching the policies data!', error);
      });
  }, []);

  const handleSort = (field) => {
    const direction = sortBy === field && sortDirection === 'asc' ? 'desc' : 'asc';
    setSortBy(field);
    setSortDirection(direction);
    setFilteredPolicies(sortData(policies, field, direction));
  };

  const handleApprove = (policyId) => {
    axios.post(`http://localhost:8080/policies/approve/${policyId}`)
      .then(response => {
        console.log('Policy approved:', response.data);
        // Refresh the list
        setPolicies(policies.filter(policy => policy.dataPolicyId !== policyId));
        setFilteredPolicies(filteredPolicies.filter(policy => policy.dataPolicyId !== policyId));
      })
      .catch(error => {
        console.error('There was an error approving the policy:', error);
      });
  };

  const handleReject = (policyId) => {
    const reason = prompt('Please provide a reason for rejection:');
    if (reason) {
      axios.post(`http://localhost:8080/policies/reject/${policyId}`, { reason })
        .then(response => {
          console.log('Policy rejected:', response.data);
          // Refresh the list
          setPolicies(policies.filter(policy => policy.dataPolicyId !== policyId));
          setFilteredPolicies(filteredPolicies.filter(policy => policy.dataPolicyId !== policyId));
        })
        .catch(error => {
          console.error('There was an error rejecting the policy:', error);
        });
    }
  };

  return (
    <div className="policy-approval-table">
      <h2>Policy Approval Overview</h2>
      <table>
        <thead>
          <tr>
            <th onClick={() => handleSort('dataPolicyId')}>Policy ID</th>
            <th onClick={() => handleSort('dataPolicyName')}>Policy Name</th>
            <th onClick={() => handleSort('dataPolicyVersion')}>Version</th>
            <th onClick={() => handleSort('dataPolicyLastModified')}>Last Modified</th>
            <th onClick={() => handleSort('dataPolicyCreator')}>Creator</th>
            <th onClick={() => handleSort('dataPolicyExaminer')}>Examiner</th>
            <th onClick={() => handleSort('dataPolicyStatus')}>Status</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {filteredPolicies.map((policy, index) => (
            <tr key={index}>
              <td>{policy.dataPolicyId}</td>
              <td>{policy.dataPolicyName}</td>
              <td>{policy.dataPolicyVersion}</td>
              <td>{new Date(policy.dataPolicyLastModified).toLocaleDateString()}</td>
              <td>{policy.dataPolicyCreator}</td>
              <td>{policy.dataPolicyExaminer}</td>
              <td>{policy.dataPolicyStatus}</td>
              <td>
                <button onClick={() => handleApprove(policy.dataPolicyId)}>Approve</button>
                <button onClick={() => handleReject(policy.dataPolicyId)}>Reject</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default PolicyApprovalTable;
